import React from "react";
import "./Card.scss";

const Card = props => {
  return (
    <section className="todo">
      <section
        className="card"
        style={{ backgroundImage: `url(${props.img})` }}
      >
        <h1 style={{ color: props.color }}>{props.title}</h1>
        <div className="contenedor-Texto">
        <p>{props.texto}</p>
        <thead>
            <tr>
                <th>Aerobicos</th>
                <th>Localizada</th>
                <tr><td>{props.texto4} <input type="checkbox" className="input1"/></td></tr>
                <tr><td>{props.texto5} <input type="checkbox" className="input1"/></td></tr> 
                <tr><td>{props.texto6} <input type="checkbox" className="input1"/></td></tr>
            </tr>
        </thead>
        <tbody>
                <tr><td>{props.texto1} <input type="checkbox" className="input1"/></td></tr>
                <tr><td>{props.texto2} <input type="checkbox" className="input1"/></td></tr> 
                <tr><td>{props.texto3} <input type="checkbox" className="input1"/></td></tr> 
        </tbody>
        </div>
      </section>
    </section>
  );
};

export default Card;
